import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
const CardList = () => {
    const auth = localStorage.getItem('user');
    const [cards, setCards] = useState([]);
    const navigate = useNavigate();
    useEffect(() => {
        if (!(auth)) {
            navigate('/login');
        }

        const fetchCards = async () => {
            try {
                const response = await fetch("http://localhost:5000/api/card");
                const data = await response.json();
                setCards(data);
            } catch (error) {
                console.error("Error fetching vehicles:", error);
            }
        };

        fetchCards();


    }, [auth, navigate])
    const getImageUrl = (imageName) => {
        return `http://localhost:5000${imageName}`;
    };

    return (
        <form className="inline-grid mt-10 ">
            <div className="mt-12">
                <h1 className="text-red-400 font-bold text-2xl">My Card List</h1>
                <div className="inline-grid">
                    {cards.length > 0 ? <> {
                        cards.map((card) => (
                            <div className=" my-2 bg-slate-400 w-fit rounded-lg mx-2 flex ">
                                <div key={card._id} />
                                <img src={getImageUrl(card.image)} className="m-2 p-2 rounded-xl w-28 h-24" />
                                <span className=" text-2xl font-bold pt-10 px-2">{card.name.toUpperCase()}</span>
                                <span className=" text-lg pt-10 px-2">{card.category}</span>
                                <span className=" text-lg pt-10 px-2">{card.price}</span>
                                <span className=" text-lg pt-10 px-2">{card.registrationNo}</span>
                            </div>
                        ))
                    }</>
                        :
                        <h1 className="mt-20 text-5xl  text-red-600">No card available !</h1>
                    }

                </div>
            </div>
        </form>
    )
}


export default CardList;
